import React from 'react';
import ReactDom from 'react-dom';
let message = " ";
const time = new Date().getHours();

if (time >= 1 && time <= 12) {

  message = "Good Morning";

}
if (time > 12 && time < 8) {

  message = "Good Evening";

}
else {
  message = "Good Night";
}
ReactDom.render(<h1>Hello World!!  {message}  {time}</h1>, document.getElementById('root'));
